import React from 'react';
import Button from '@mui/material/Button';

function Navbar() {
  return (
    <nav class="nav-bar">
      <Button color="primary">Home</Button>
      <Button color="primary">Favourites</Button>
      <Button color="primary" class="nav-bar-square-button">Home</Button>
    </nav>
  );
}

export default Navbar;
